import { Avatar, Container, Grid, Paper, TextField, Typography } from '@mui/material'
import LockOutlinedIcon from '@mui/icons-material/LockOutlined';
import React from 'react'

function Auth() {
    const isSignUp = false

    const handleSubmit = () => {
        console.log('jelly')
    }

    const handleChange = () => {
        console.log('jam')
    }
    
    return (
        <Container maxWidth="xs">
            <Paper elevation={3}>
                <Avatar>
                    <LockOutlinedIcon />
                </Avatar>

                <Typography variant="h5">{isSignUp ? "Sign Up" : "Sign In"}</Typography>

                <form onSubmit={handleSubmit}>
                    <Grid container spacing={2}>
                        {isSignUp && (
                            <>
                                <TextField name="firstName" label="First Name" handleChange={handleChange} autoFocus xs={6} />
                                <TextField name="lastName" label="Last Name" handleChange={handleChange} autoFocus xs={6} />
                            </>
                        )}
                    </Grid>
                </form>
            </Paper>
        </Container>
    )
}

export default Auth
